import React from 'react';
import teamsAL from './Data/teams2016_al.json'
import teamsNL from './Data/teams2016_al.json'
import teamsALBump from './Data/al_bump.json'
import batters from './Data/batters2016.json'
import pitchers from './Data/pitchers2016.json'
import {ResponsiveBar} from "@nivo/bar";
import {ResponsiveBump} from '@nivo/bump';

import {linearGradientDef, patternDotsDef} from '@nivo/core'


import Grid from "@material-ui/core/Grid";

function AmericanLeague() {

    const [selection, setSelection] = React.useState("American League");


    return (
        <Grid container justify="center">
            <div style={{height: 350, width: 1000}}>
                <ResponsiveBar
                    data={teamsAL}
                    keys={["Left Fielders", "Center Fielders", "Right Fielders", "1st Basemen", "2nd Basemen", "Short Stops", "3rd Basemen", "Catchers", "Designated Hitters", "Pitchers"]}
                    indexBy="teamID"
                    margin={{top: 50, right: 130, bottom: 50, left: 60}}
                    padding={0.3}
                    colors={{scheme: 'category10'}}
                    enableLabel={false}

                    defs={[
                        {
                            id: 'dots',
                            type: 'patternDots',
                            background: 'inherit',
                            color: '#000000',
                            size: 4,
                            padding: 1,
                            stagger: true
                        },
                        {
                            id: "dots2",
                            "type": "patternLines",
                            background: 'inherit',
                            "spacing": 7,
                            "rotation": 121,
                            "lineWidth": 2,
                            "color": "#eeff00"
                        }
                    ]}
                    fill={[
                        {
                            match: d => d.data.data.LgWin === 'Y', id: 'dots2'
                            // === 'Y', id:'gradientC'
                        }

                    ]}
                    borderColor={{from: 'color', modifiers: [['darker', 1.6]]}}
                    axisTop={null}
                    axisRight={null}
                    axisBottom={{
                        // tickSize: 5,

                        // tickRotation: 0,
                        // legend: 'name',
                        // legendPosition: 'middle',
                        // legendOffset: 32,
                        // tickValues: 1,
                        //
                        renderTick: CustomTick
                    }}
                    axisLeft={{
                        tickSize: 5,
                        tickPadding: 5,
                        tickRotation: 0,
                        legend: 'Pay Roll in Millions',
                        legendPosition: 'middle',
                        legendOffset: -50,
                        format: function (value) {
                            value = (value / 1000000).toString()
                            return ('$').concat(value);

                        }
                    }}
                    labelSkipWidth={12}
                    labelSkipHeight={12}
                    labelTextColor={{from: 'color', modifiers: [['darker', 1.6]]}}
                    legends={[
                        {
                            dataFrom: 'keys',
                            anchor: 'bottom-right',
                            direction: 'column',
                            justify: false,
                            translateX: 120,
                            translateY: 0,
                            itemsSpacing: 2,
                            itemWidth: 100,
                            itemHeight: 20,
                            itemDirection: 'left-to-right',
                            itemOpacity: 0.85,
                            symbolSize: 20,
                            effects: [
                                {
                                    on: 'hover',
                                    style: {
                                        itemOpacity: 1
                                    }
                                }
                            ]
                        }
                    ]}
                    animate={true}
                    motionStiffness={90}
                    motionDamping={15}
                />
            </div>
            <div style={{height: 450, width: 1000}}>
                <h3>Ranking Teams Across Statistical Categories: From Team Total Payroll to Total Wins in 2016</h3>
                <ResponsiveBump
                    data={teamsALBump}
                    margin={{top: 40, right: 100, bottom: 40, left: 60}}
                    colors={{scheme: 'category10'}}
                    lineWidth={3}
                    activeLineWidth={6}
                    inactiveLineWidth={3}
                    inactiveOpacity={0.15}
                    pointSize={10}
                    activePointSize={16}
                    inactivePointSize={0}
                    pointColor={{theme: 'background'}}
                    pointBorderWidth={3}
                    activePointBorderWidth={3}
                    pointBorderColor={{ from: 'serie.color' }}
                    axisTop={{
                        tickSize: 5,
                        tickPadding: 5,
                        tickRotation: 0,
                        legend: '',
                        legendPosition: 'middle',
                        legendOffset: -36
                    }}
                    axisRight={{
                        // tickSize: 5,

                        // tickRotation: 0,
                        // legend: 'name',
                        // legendPosition: 'middle',
                        // legendOffset: 32,
                        // tickValues: 1,
                        //
                        renderTick: CustomTick_bump
                    }}
                    axisBottom={{
                        tickSize: 5,
                        tickPadding: 5,
                        tickRotation: 0,
                        legend: '',
                        legendPosition: 'middle',
                        legendOffset: 32
                    }}
                    axisLeft={{
                        tickSize: 5,
                        tickPadding: 5,
                        tickRotation: 0,
                        legend: 'ranking',
                        legendPosition: 'middle',
                        legendOffset: -40
                    }}
                />
            </div>

        </Grid>
    );


}

